    "2016-04-19T02:28:06.966429",nt"name": "grasslands",nt"isopen": false,nt"url":
    null,nt"notes": "Grasslands are areas of undeveloped land in the Austin ETJ
    where the dominant vegetation consists of sizeable communities of predominantly
    native grasses. The purpose of this feature class is to track the preservation of
    grassland or prairie areas. These grasslands were digitized from construction plans,
    environmental assessments, and City of Austin staff field observations into a versioned
    SDE database using ArcMap. Actual areas for any particular feature may be fluctuate
    due to antecedent rainfall, subsequent development activity or the invasion of woody
    species, Grasslands are not, at the time of this writing, a protected Critical Environmental
    Feature.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
